const size = [
  data["data"][index].w, 
  data["data"][index].h
] as vec2;

const pos = [
  data["data"][index].x + data["data"][index].w / 2,
  2400 - data["data"][index].y - data["data"][index].h / 2,
] as vec2;

const count = data["data"].length as int;

return { pos , size, count };
